import React from "react";
import { Route, BrowserRouter } from "react-router-dom";

import App from "App.js";
import home from "pages/home.js";

const Routes = () => {
   return(
       <BrowserRouter>
           <Route component = { App }  path="/" />
           <Route component = { home }  path="/home" />
       </BrowserRouter>
   )
}

export default Routes;
